'use strict';THREE.NURBSSurface=function(degree1,degree2,knots1,knots2,controlPoints){this.degree1=degree1;this.degree2=degree2;this.knots1=knots1;this.knots2=knots2;this.controlPoints=[];let len1=knots1.length-degree1-1;let len2=knots2.length-degree2-1;for(let i=0;i<len1;++i){this.controlPoints[i]=[];for(let j=0;j<len2;++j){let point=controlPoints[i][j];this.controlPoints[i][j]=new THREE.Vector4(point.x,point.y,point.z,point.w)}}};THREE.NURBSSurface.prototype={constructor:THREE.NURBSSurface,getPoint:function(t1,t2,target){let u=this.knots1[0]+t1*(this.knots1[this.knots1.length-1]-this.knots1[0]);let v=this.knots2[0]+t2*(this.knots2[this.knots2.length-1]-this.knots2[0]);THREE.NURBSUtils.calcSurfacePoint(this.degree1,this.degree2,this.knots1,this.knots2,this.controlPoints,u,v,target)}}